function initTracker(baseUri){let tracker={trackCustom:function(e,d){fetch(`${baseUri}/v1/tracking/custom?cts=${Date.now()}&e=${e}&d=${d}`).then(r=>r.text())},trackPageView:function(d){fetch(`${baseUri}/v1/tracking/pageview?cts=${Date.now()}&d=${d}`).then(r=>r.text())},trackClick:function(d){fetch(`${baseUri}/v1/tracking/click?cts=${Date.now()}&d=${d}`).then(r=>r.text())}};return tracker}